import { createRoot } from 'react-dom/client';
import HomePage from './landing page/home/HomePage';
import './index.css';

const container = document.getElementById('root');
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <React.StrictMode>
        <HomePage/>
    </React.StrictMode>
)
